script: |
  super -f text -I q2548.spq | sort > q2548.out

inputs:
  - name: q2548.spq
    data: |
      SELECT col1 AS col1 FROM tab0 (FORMAT parquet) WHERE NOT ( - tab0.col1 / col2 + col2 + col2 * col0 ) IN ( col2 * col0 );
  - name: tab0

outputs:
  - name: q2548.out
    data: |
      86
      91
      97
